,(2139,1362645,51486,2018,227857.14,222857.14,5000.00,2,'Execução de obra de implantação em espaço urbano , considerando a melhoria e requalificação urbana, sinalização e acessibilidade entre as ruas águas da prata(lindóia) e rua Andradina.
Trata-se de construção de passeio, drenagem, muro de arrimo,murro de vedação,escadaria e cx de dissipação que interligará as ruas acima descritas, facilitando o acesso dos pedestres aos ônibus Municipais que interligam o bairro do Botujuru ao centro de Campo Limpo Paulista.

Atualmente os pedestre fazem um percusso de 2 Km para contornar a rua Andradina e ter acesso a rua Águas da Prata(Lindóia) e assim ao ponto de ônibus.


obs:Ação Orçamentária 1D73: Apoio à Política Nacional de Desenvolvimento Urbano.

