,(4549,1391943,61649,2018,250000.00,250000.00,0.00,1,'Localizada no Agreste de Pernambuco, na Microrregião do Alto Capibaribe, distante 170 Km da capital Recife, Taquaritinga do Norte tem uma área de 475 Km2, possui uma população estimada de 27.981 habitantes, que em sua maior parte é composta de adultos jovens, apresentando um número de mulheres superior ao número de homens, apresentando uma densidade demográfica de 52,41 hab/ km2 e divide-se administrativamente, pela Sede e pelos distritos de Gravatá do Ibiapina e Pão de açúcar e pelos povoados de Vila do Socorro, Mateus Vieira, Jerimum, Algodão, Pedra Preta, dentre outros, apresentando também uma extensa zona rural composta por dezenas de sítios e pequenas comunidades. Anualmente, no dia 10 de maio comemora a sua emancipação política desta cidade que primitivamente fora uma taba de índios e começou a ser povoada em meados do século XVIII. O nome da cidade tem origem indígena - “itacoaraetetinga”, que significa buraco da pedra grande. A sede apresenta uma altitude de 785 m acima do nível do mar e o município, limita-se territorialmente ao norte com o estado da Paraíba, ao sul com os municípios de Toritama, Caruaru e Brejo da Madre de Deus, ao leste com o município das Vertentes e a oeste com a cidade de Santa Cruz do Capibaribe. O Índice de Desenvolvimento Humano (IDH) do município de Taquaritinga do Norte é 0,688, se comparado ao do estado brasileiro que é de 0,807. O município de Taquaritinga do Norte segue o contexto nacional ao adotar a atenção básica a saúde como principal modelo de atenção, baseado na estratégia de Saúde da Família que visa reorganizar o modelo de atenção básica no país partindo de princípios fundamentais do SUS: integralidade, universalidade, equidade e participação social. A partir desses princípios as equipes de saúde da família estabelecem vinculo de co-responsabilidade e compromisso com a população. Atualmente, Taquaritinga do Norte conta com 07 (sete) equipes de Saúde da Família, todas estão contempladas com saúde bucal. Possui 40 Agentes Comunitários de Saúde que realizam suas atividades dentro dos limites geográficos do município. Entretanto, como a extensão territorial do município é muito grande, os Agentes Comunitários de Saúde detectaram em várias comunidades a escassez de saneamento básico, principalmente em comunidades mais remotas, onde os impactos gerados afetam diretamente a qualidade de vida da população, onde a boa parte dos residentes ainda precisam carregar baldes e utilizam banheiros arcaicos, que muitas vezes não possuem nem vaso sanitário e o descarte dos esgotos é feito de maneira incorreta e sem higiene, tornando esta população vulnerável a doenças que poderiam ser evitadas mediante ações pontuais. Para reduzir este problema, se torna imprescindível, a implantação de ações de melhorias no saneamento básico com o objetivo de atender a todas às necessidades básicas de saneamento das famílias beneficiadas, por meio de instalações hidrossanitárias mínimas, relacionadas ao uso da água, à higiene e ao destino adequado dos esgotos domiciliares, além disto, contribuirão para a redução das doenças e dos índices de mortalidade provocados pela falta ou inadequação das condições de saneamento domiciliar. Diante deste déficit de instalações sanitárias adequadas e das grandes distâncias entre as casas da zona rural de Taquaritinga do Norte, detectou-se a inviabilidade para construção de sistemas públicos de esgotamento sanitário, se sobressaindo como alternativa mais viável para atender a população destas localidades a construção de melhorias sanitárias domiciliares que compreendem: construção de privada com conjunto sanitário completo, tanque de lavar roupas, pia de cozinha, caixas de passagem e gordura, fossa e sumidouro para cada beneficiado relacionado, motivando o pleito municipal junto a FUNASA para a viabilização de recursos que possibilitem a construção de 27 (vinte e sete) melhorias sanitárias domiciliares para atender diversas localidades na zona rural deste município, devendo as mesmas serem construídas nos padrões da FUNASA, obedecendo a todas as especificações técnicas definidas por esta instituição.',879494,2018,NULL,'3621120180018','2068 - Saneamento Basico ( Acao - 7652 - Melhorias Sanitarias Domiciliares - MSD)','10091593000100','MUNICIPIO DE TAQUARITINGA DO NORTE','PE',0.00,NULL,'OBRAS_SERVICOS_ENGENHARIA',0,'CONTRATO_NIVEL_I',0,NULL,NULL)
