,(6233,1402448,63935,2018,8179133.53,8179133.53,0.00,1,'a) Geral
O presente projeto tem por objetivo assegurar a estruturação de Laboratório de atletismo e de esportes de alto rendimento, propiciando melhorias na infraestrutura necessária ao seu funcionamento.
b )Específicos:
a)O presente projeto de pesquisa tem como objetivo geral amplo de avaliar e comparar variáveis de desempenho físico antes e após o período de preparação físico dos atletas que compõe a equipe de atletismo do Centro de Educação Física e Desporto (CEFD) da UFSM.
b)Comparar o desempenho de atletas no período pré-competitivo com o desempenho após período de treinamento; 
c)Avaliar o desempenho de atletas de alto nível que participem de competições que ocorram no novo espaço.
d)Modernização da Pista de Atletismo da Universidade Federal de Santa Maria como laboratório de pesquisa e práticas relacionadas aos esportes de alto rendimento, de acordo com os padrões da Federação Internacional de Atletismo (IAAF).
e)Adequar o espaço físico para realizar provas de Atletismo nos diversos níveis de competição (municipal, estadual, nacional e mundial);
f)Fortalecer o aprendizado extraclasse, oportunizando atividades de extensão, inserção na sociedade, empreendedorismo, pesquisa e inovação;
g)Fomentar a execução de diferentes projetos de pesquisa, ensino e extensão aplicados a problemas da universidade e sociedade;
h)Qualificar o espaço físico como laboratório para práticas e pesquisas na área de esportes de alto rendimento;
i)Habilitar a pista de atletismo da UFSM para a realização o treinamento de atletas de alto rendimento em todas as provas da modalidade;',879618,2018,'2018-12-12','2624720180003','Implantação de Infraestrutura Esportiva de Alto Rendimento','89252431000159','FUNDACAO DE APOIO A TECNOLOGIA E CIENCIA','RS',0.00,NULL,'OBRAS_SERVICOS_ENGENHARIA',0,'CONTRATO_NIVEL_III',0,NULL,NULL)
