,(6238,1364307,52582,2018,336135.00,331042.05,5092.95,1,'Pretendemos auxiliar o pequeno agricultor nas suas atividades do campo, para que o mesmo possa permanecer em suas
propriedades exercendo suas atividades com seus familiares, evitando o transtorno que ocorre quando uma família inteira chega
a uma cidade sem o mínimo de formação necessária para o ingresso no mercado de trabalho, não estamos taxando que os
camponeses não têm estudo, mas sim, estamos relatando a triste situação de um simples sitiante quando vende sua propriedade
rural para vir morar na cidade o que é uma realidade vivenciada por muitos,
vemos pessoas que tentam melhorar suas vidas na cidade, mas sabemos que isso torna-se difícil para aqueles que não se
preparam para realizar grandes mudanças de hábitos. Com a permanência do homem no campo, podemos auxiliá-lo na
produção, no transporte e na comercialização de seus produtos, fortalecer o setor primário está dentro do rol de prioridades
definidas e discutidas em conjunto com os membros das Associações Rurais, chegando-se à conclusão de que há necessidade de
implantação de mecanismos que sejam capazes de proporcionar o efetivo desenvolvimento do setor primário do nosso
município, visto ser o mesmo que tem ao longo dos anos contribuído para a geração de emprego, renda e permanência das
famílias no campo com qualidade de vida superior a daquelas que deixaram suas propriedades e imigraram paras as cidades,
com isso o município poderá dar mais assistência aos produtores rurais,vale ressaltar que a base da economia deste município é
a agricultura e a pecuária. Diante do exposto, à aprovação do referido pleito, certamente será de grande importância no apoio de
assistência aos produtores rurais, com isso o crescimento e desenvolvimento deste município terão grande avanço.',875523,2018,NULL,'5300020180005','SDR/MI - 2029 PROGRAMA DE DESENVOLVIMENTO REGIONAL E TERRITORIAL - EMENDA','10249241000122','MUNICIPIO DE SAO GERALDO DO ARAGUAIA','PA',1.00,NULL,'OBRAS_SERVICOS_ENGENHARIA',0,'CONTRATO_NIVEL_I',0,NULL,NULL)
